    { id: "aberdeen", src: './images/universities/aberdeen.jpg' },
    { id: "plymouth", src: './images/universities/plymouth.jpg' },
    { id: "wales", src: './images/universities/wales.jpg' },
    { id: "dundee", src: './images/universities/dundee.jpg' },
    { id: "agakhan", src: './images/universities/agakhan.jpg' },
    { id: "angliaruskin", src: './images/universities/angliaruskin.jpg' }
]

